  [],\n\t\"revision_timestamp\": \"2016-03-31T23:57:40.103435\",\n\t\"name\": \"enviroatlas-green-bay-wisconsin-one-meter-resolution-urban-land-cover-data-2010\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Green Bay, WI one meter-scale urban
  land cover (LC) dataset comprises 936 km2 around the city of Green Bay, surrounding
  towns, tribal lands and rural areas in Brown and Outagamie Counties. These leaf-on
  LC data and maps were derived from 1-m pixel, four-band (red, green, blue, and near-infrared)
  aerial photography acquired from the United States Department of Agriculture (USDA)
  National Agriculture Imagery Program (NAIP) on three dates in 2010: July 3, July
  25, and August 5. LiDAR data collected on November 18, 2010 was integrated for the
  Brown County portion. Eight land cover classes were mapped: water, impervious surfaces,
  soil and barren land, trees and forest, grass and herbaceous non-woody vegetation,
  agriculture, and wetlands (woody and emergent). Wetlands were copied from the best
  available existing wetlands data. Analysis of a random sampling of 566 photo-interpreted
  land cover reference points yielded an overall accuracy of 91.3%. This dataset was
  produced by the US EPA to support research and online mapping activities related
  to EnviroAtlas. EnviroAtlas (https://www.epa.gov/enviroatlas) allows the user to
  interact with a web-based, easy-to-use, mapping application to view and analyze
  multiple ecosystem services for the contiguous United States. The dataset is available
  as downloadable data (https://edg.epa.gov/data/Public/ORD/EnviroAtlas) or as an
  EnviroAtlas map service. Additional descriptive information about each attribute
  in this dataset can be found in its associated EnviroAtlas Fact Sheet (https://www.epa.gov/enviroatlas/enviroatlas-fact-sheets
  ).\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
